import React from "react";
import HeaderLogedin from "../components/headerLogedin";
import { Box, Divider, Paper, Stack, Typography } from "@mui/material";
import Grid from "@mui/material/Grid";
import { Link, Outlet } from "react-router-dom";

export default function Profile() {
  const ContainerStyle = {
    marginTop: "20px",
    marginBottom: "50px",
    padding: "20px",
    backgroundColor: "#F0F0F0",
  };
  const ColumnStyle = {
    backgroundColor: "white",
    borderRadius: "3px",
    marginBottom: "5px",
    padding: "20px",
    justifyContent: "flex-end",
    alignItems,
  };
  const iconStyle = {
    width: "20px",
    height: "20px",
    marginLeft: "20px",
  };
  const PositionStyle = {
    padding: "10px",
    marginBlock: "5px",
    justifyContent: "flex-end",
    alignItems: "center",
    "&:hover": {
      bgcolor: "custom.main",
    },
  };

  return (
    <>
      <HeaderLogedin />
      <Divider sx={{ marginTop: "80px" }} />
      <Paper sx={ContainerStyle} elevation={5}>
        <Grid container sx={{}} spacing={0}>
          <Grid item xs={6} md={9} sx={{ paddingLeft: "5px", height: "100%" }}>
            <Box sx={[ColumnStyle, { height: "528px" }]}>
              <Outlet />
            </Box>
          </Grid>
          <Grid item xs={6} md={3}>
            <Stack direction="row" sx={ColumnStyle}>
              <Box>
                <Typography variant="h5">به پلاک ۲۶ خوش آمدید</Typography>
                <Typography sx={{ mt: "10px", textAlign: "left" }} variant="h5">
                  ۰۹۱۲۴۳۵۶۶۸۸
                </Typography>
              </Box>
              <img
                style={{
                  width: "40px",
                  height: "40px",
                  marginLeft: "30px",
                  borderRadius: "100px",
                }}
                src={require("../assets/images/Profile.png")}
              />
            </Stack>
            <Stack sx={[ColumnStyle, { height: "442px" }]}>
              <Stack
                direction="row"
                sx={PositionStyle}
                component={Link}
                to="dashboard"
              >
                <Box>
                  <Typography underline="none" variant="body1">
                    پیشخوان
                  </Typography>
                </Box>
                <img
                  style={iconStyle}
                  src={require("../assets/images/Vector.png")}
                />
              </Stack>

              <Stack
                direction="row"
                sx={PositionStyle}
                component={Link}
                to="subscription"
              >
                <Box>
                  <Typography variant="body1"> اشتراک</Typography>
                </Box>
                <img
                  style={iconStyle}
                  src={require("../assets/images/Vector2.png")}
                />
              </Stack>
              <Stack
                direction="row"
                sx={PositionStyle}
                component={Link}
                to="store-submit"
              >
                <Box>
                  <Typography variant="body1"> ثبت فروشگاه</Typography>
                </Box>
                <img
                  style={iconStyle}
                  src={require("../assets/images/Vector3.png")}
                />
              </Stack>
              <Stack
                direction="row"
                sx={PositionStyle}
                component={Link}
                to="insert-ad"
              >
                <Box>
                  <Typography variant="body1"> درج آگهی </Typography>
                </Box>
                <img
                  style={iconStyle}
                  src={require("../assets/images/Vector4.png")}
                />
              </Stack>
              <Stack
                direction="row"
                sx={PositionStyle}
                component={Link}
                to="support"
              >
                <Box>
                  <Typography variant="body1">پشتیبانی</Typography>
                </Box>
                <img
                  style={iconStyle}
                  src={require("../assets/images/Vector5.png")}
                />
              </Stack>
              <Divider sx={{ marginBlock: "20px" }} />
              <Stack
                direction="row"
                sx={PositionStyle}
                component={Link}
                to="profile-info"
              >
                <Box>
                  <Typography variant="body1"> حساب کاربری</Typography>
                </Box>
                <img
                  style={iconStyle}
                  src={require("../assets/images/Vector6.png")}
                />
              </Stack>
              <Stack direction="row" sx={PositionStyle}>
                <Box>
                  <Typography variant="body1">خروج از حساب</Typography>
                </Box>
                <img
                  style={iconStyle}
                  src={require("../assets/images/Vector7.png")}
                />
              </Stack>
            </Stack>
          </Grid>
        </Grid>
      </Paper>
    </>
  );
}
